import './emoji.css';
import { useState } from 'react';

function Signoff(props) {
  const [ signoffTime, setSignoff ] = useState(0);

  return (
    <button className="Signoff" onClick={ () => setSignoff(Date.now()) }>
      <span className="signoff-name">Mayank Jain</span>
      <span className="signoff-time">{signoffTime.toLocaleString()}</span>
    </button>
  );
}

export default Signoff;
